	add("expectation", "{\"term\":\"expectation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|expectation}}, from Latin {{m|la|exspectātiō}}, from {{m|la|exspectō}}; synchronically analyzable as {{suffix|expect|ation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or state of expecting or looking forward to an event as about to happen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"“A tight little craft,” was Austin’s invariable comment on the matron;. \u0026amp;para; Near her wandered her husband, orientally bland, invariably affable, and from time to time squinting sideways, as usual, in the ever-renewed \u0027\u0027expectation\u0027\u0027 that he might catch a glimpse of his stiff, retroussé moustache\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which is expected or looked for\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1519647W “Piracy”: A Romantic Chronicle of These chapter\u003dEp./1/1|passage\u003dAnd so it had always pleased M. Stutz to expect great things from the dark young man whom he had first seen in his early twenties ; and his \u0027\u0027expectations\u0027\u0027 had waxed rather than waned on hearing the faint bruit of the love of Ivor and Virginia—for Virginia, M. Stutz thought, would bring fineness to a point in a man like Ivor Marlay\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The prospect of the future; grounds upon which something excellent is expected to occur; prospect of anything good to come, especially of property or rank\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1816\u0027\u0027, w:Emma Emma, Vol.1 Ch.7\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Emma was not sorry to be pressed. She read, and was surprized. The style of the letter was much above her \u0027\u0027expectation\u0027\u0027. There were not merely no grammatical errors, but as a composition it would not have disgraced a gentleman; the language, though plain, was strong and unaffected, and the sentiments it conveyed very much to the credit of the writer. It was short, but expressed good sense, warm attachment, liberality, propriety, even delicacy of feeling. She paused over it, while Harriet stood anxiously watching for her opinion, with a \u0026quot;Well, well,\u0026quot; and was at last forced to add, \u0026quot;Is it a good letter? or is it too short?\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The value of any chance (as the prospect of prize or property) which depends upon some contingent event\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The first moment; the long-run average value of a variable over many independent repetitions of an experiment\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The arithmetic mean\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The leaving of a disease principally to the efforts of nature to effect a cure.\u0026lt;!-- Example sentence please?: \u0026quot;(usage: \u0026quot;expectant management\u0026quot;, \u0026quot;tincture of time\u0026quot;)\u0026quot; --\u0026gt\", \"priority\":11}]}, \"synonyms\":{}}");

