	add("expedience", "{\"term\":\"expedience\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027expedience\u0027 from \u0027expedientia\u0027 from Latin \u0027expediens\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being fit or suitable to effect some desired end or the purpose intended; propriety or advisability under the particular circumstances of a case\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"To determine concerning the \u0027\u0027expedience\u0027\u0027 of action\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Speed, haste or urgency\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Making hither with all due \u0027\u0027expedience\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, w:Jeffrey J. Jeffrey J. Rowland, \u0027[http://www.wigucomics.com/adventures/index.php?comic\u003d992 Wigu: Day 13: Saturday in the Park\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"We must spring into action with a relentless sense of \u0027\u0027expedience\u0027\u0027 and determination\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Something that is expedient\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An expedition; enterprise; adventure\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Forwarding this dear \u0027\u0027expedience\", \"priority\":11}]}, \"synonyms\":{}}");

