	add("expense", "{\"term\":\"expense\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027expense\u0027 from Old french (842-ca. 1400) \u0027espense\u0027 from {{m|la|expēnsa}}, from Latin {{m|la|expendō}}. See expend.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spending or consuming. Often specifically an act of disbursing or spending funds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She went to great \u0027\u0027expense\u0027\u0027 to ensure her children would get the best education\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Buying the car was a big \u0027\u0027expense\u0027\u0027, but will be worth it in the long run\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We had a training weekend in New York, at the \u0027\u0027expense\u0027\u0027 of our company\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"w:William William Shakespeare, Sonnet 44\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Husband nature\u0027s riches from \u0027\u0027expense\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That which is expended, laid out, or consumed. Sometimes with the notion of loss or damage to those on whom the expense falls\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Jones reached the final at the \u0027\u0027expense\u0027\u0027 of Jones, who couldn´t beat him\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"w:William William Shakespeare, Sonnet 30\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"And moan the \u0027\u0027expense\u0027\u0027 of many a vanished sight\", \"priority\":10}]}, \"synonyms\":{}}");

	add("experience", "{\"term\":\"experience\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) from Latin \u0027experientia\u0027 (a trial, proof, experiment, experimental knowledge, experience) from \u0027\u0027 present participle of \u0027experiri\u0027 () from \u0027ex\u0027 () + *\u0027\u0027 (periri) in past participle \u0027peritus\u0027 () see \u0027\u0027 and \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Event(s) of which one is cognizant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An activity which one has performed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A collection of events and/or activities from which an individual or group may gather knowledge, opinions, and skills\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The knowledge thus gathered\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/science/2013/may/29/killer-robots-ban-un-warning \u0026amp;lsquo;Killer robots\u0026amp;rsquo; should be banned in advance, UN passage\u003dIn his submission to the UN, [Christof] Heyns points to the \u0027\u0027experience\u0027\u0027 of drones. Unmanned aerial vehicles were intended initially only for surveillance, and their use for offensive purposes was prohibited, yet once strategists realised their perceived advantages as a means of carrying out targeted killings, all objections were swept out of the way\", \"priority\":5}]}, \"synonyms\":{}}");

