	add("experimentation", "{\"term\":\"experimentation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Latin \u0027ex-\u0027 + \u0027-periri\u0027 (akin to \u0027periculum\u0027), attempt\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of experimenting; practice by experiment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A set of actions and observations, performed to verify or falsify a hypothesis or to research a causal relationship between phenomena\", \"priority\":2}]}, \"synonyms\":{}}");

	add("expertise", "{\"term\":\"expertise\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|expertise|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Great skill or knowledge in a particular field or hobb\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The scientist has expertise in the field of nuclear fusion\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Michael White, \u0026quot;[http://www.theguardian.com/politics/2014/sep/08/salmond-scotland-independence-first-minister Roll up, roll up! The Amazing Salmond will show a Scotland you won\u0027t believe]\u0026quot;, \u0027The Guardian\u0027, 8 September 2014\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He spoke of Scotland\u0027s hydroelectric projects in Africa, local \u0027\u0027expertise\u0027\u0027 shared with the world\u0027s poor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"advice, or opinion, of an expert\", \"priority\":5}]}, \"synonyms\":{}}");

