	add("explorer", "{\"term\":\"explorer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|explore}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|upright|One end of a dental explorer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who explores somethin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who by means of travel (notably an expedition) searches out new information\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of various hand tools, with sharp points, used in dentistry\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A visual representation of a file system etc. through which the user can navigate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Mark Minasi, John Paul Mueller, \u0027Mastering Windows Vista Business: Ultimate, Business, and Enterprise\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For example, Vista includes a document \u0027\u0027explorer\u0027\u0027 that shows just the documents in a location without considering all of the other files that might appear there\", \"priority\":7}]}, \"synonyms\":{}}");

