	add("explosion", "{\"term\":\"explosion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027explosion\u0027 from Latin {{m|la|explōsiōnis}}, genitive form of {{m|la|explōsio}}, from {{m|la|explōdo||I drive out by clapping}}, from \u0027ex-\u0027 and {{m|la|plōdo||I clap or strike}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A violent release of energy (sometimes mechanical, nuclear, or chemical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/world/2013/jun/18/japan-solar-energy-fukushima-nuclear-renewable-abe Japan pockets the subsidy passage\u003dAcross Japan, technology companies and private investors are racing to install devices that until recently they had little interest in: solar panels. Massive solar parks are popping up as part of a rapid build-up that one developer likened to an \u0026quot;\u0027\u0027explosion\u0027\u0027.\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bursting due to pressure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The sound of an explosion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A sudden uncontrolled increase\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"As with the Lejeuneaceae, this pattern of massive speciation appears to be correlated with the Cretaceous \u0027\u0027explosion\u0027\u0027 of the angiosperms and the simultaneous creation of a host of new microenvironments, differing in humidity, light intensity, texture, etc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sudden outburst\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/leaders/21583277-worlds-biggest-polluter-going-green-it-needs-speed-up-transition-can-china Can China clean up fast passage\u003dAll this has led to an \u0027\u0027explosion\u0027\u0027 of protest across China, including among a middle class that has discovered nimbyism. That worries the government, which fears that environmental activism could become the foundation for more general political opposition. It is therefore dealing with pollution in two ways—suppression and mitigation\", \"priority\":8}]}, \"synonyms\":{}}");

