	add("exposure", "{\"term\":\"exposure\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|expose|ure|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being exposed, uncovered, or unprotected\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/business/21579011-president-proposes-new-round-intellectual-property-reform-obama-goes-troll-hunting Obama goes passage\u003dThe solitary, lumbering trolls of Scandinavian mythology would sometimes be turned to stone by \u0027\u0027exposure\u0027\u0027 to sunlight. Barack Obama is hoping that several measures announced on June 4th will have a similarly paralysing effect on their modern incarnation, the patent troll\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That part which is facing or exposed to something, e.g. the sun, weather, sky, or a view\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Lack of protection from weather or the elements\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, \u0027The Ugly Boy\u0027, Dark Horse Book\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"As all of you know, a great tragedy occurred yesterday. Arthur Harcourt died of \u0027\u0027exposure\u0027\u0027 sometimes in the morning in the woods off Mount Tom Road\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An instance of taking a photograph\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The piece of film exposed to light\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Details of the time and f-number used\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The amount of sun, wind etc. experienced by a particular site\", \"priority\":10}]}, \"synonyms\":{}}");

