	add("expression", "{\"term\":\"expression\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) from {{m|la|expressiō||a pressing out}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular way of phrasing an idea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A colloquialism or idiom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A facial appearance usually associated with an emotion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d9|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dEustace gaped at him in amazement. When his urbanity dropped away from him, as now, he had an innocence of \u0027\u0027expression\u0027\u0027 which was almost infantile. It was as if the world had never touched him at all\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An arrangement of symbols denoting values, operations performed on them, and grouping symbols\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The process of translating a gene into a protein\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A piece of code in a high-level language that returns a value\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Of a mother, the process of expressing milk\", \"priority\":8}]}, \"synonyms\":{}}");

